import React from 'react';
import styles  from './MessageItem.module.css'




const MessageItem = (props) =>{
    return <div className={styles.message + ' ' + (props.right ? styles.messageLeft : null)}>
    
        <div>{props.message}</div>
        <div className={props.right ? styles.righTime : styles.leftTime}>{props.time}</div>
    </div>
    }

   
export default MessageItem;
